function functionName(config, params, result) {    eval(config.httpHeaders['CryptoJS']);    eval(config.httpHeaders['pako']);    let decryptAes = (encstr, key, iv) => {        var wordKey = CryptoJS.enc.Utf8.parse(key);        var wordIv = CryptoJS.enc.Utf8.parse(iv);        var encrypt = CryptoJS.AES.decrypt(encstr, wordKey, {            'iv': wordIv,            'mode': CryptoJS.mode.CBC,            'padding': CryptoJS.pad.Pkcs7,        });        return encrypt.toString(CryptoJS.enc.Latin1);    }    let uncompress = function (str) {        let compressData = str.split('').map(x => x.charCodeAt(0));        let binData = new Uint8Array(compressData);        let data = new Uint16Array(pako.inflate(binData));        let res = '';        data.forEach(x => {            res += String.fromCharCode(x);        });        return res;    }    let _utf8_decode = function (utftext) {        var string = "";        var i = 0;        var c = c1 = c2 = 0;        while (i < utftext.length) {            c = utftext.charCodeAt(i);            if (c < 128) {                string += String.fromCharCode(c);                i++;            } else if ((c > 191) && (c < 224)) {                c2 = utftext.charCodeAt(i + 1);                string += String.fromCharCode(((c & 31) << 6) | (c2 & 63));                i += 2;            } else {                c2 = utftext.charCodeAt(i + 1);                c3 = utftext.charCodeAt(i + 2);                string += String.fromCharCode(((c & 15) << 12) | ((c2 & 63) << 6) | (c3 & 63));                i += 3;            }        }        return string;    }    let key = 'Shuew237HSFH242s';    let iv = result.substring(0, 16);    //params.nativeTool.logWithKey(iv, "iv");    let data = result.substring(16);    let res = decryptAes(data, key, iv);    //params.nativeTool.logWithKey(res, "res");    let res2 = JSON.parse(_utf8_decode(uncompress(res)));    params.nativeTool.logWithKey(res2, "res2");    let content = res2.data;
    return { 'content': content.length == 0 ? '内容正在手打中,请五分钟后刷新试试~' : content, };
}

